import React, { Component } from "react";

class Table extends Component {
  state = {};
  render() {
    const { activities } = this.props;
    return (
      <Table>
        <thead>
          <tr>
            {Object.keys(activities[0]).map((property) => (
              <th>property</th>
            ))}
          </tr>
        </thead>
        <tbody></tbody>
      </Table>
    );
  }
}

export default Table;
